  const Search = ({match}) => {
    return (
      <>
        {match.isExact && <SearchResults />}
        <Switch>
          <Route path={`${match.path}/q=:query`} component={Search} />
        </Switch>
      </>
    )
  }


  return (
    <>
      <Navbar />
      <Switch>
        <Route path={`/search/?query=`+query.get("q")} component={Search}/>
        <Route path={["/signin"]} component={Signin} />
        <Route path={["/signup"]} component={Signup} />
        <Route path={["/home", "/"]} component={Home} />
      </Switch>
    </>
  );
}

function SearchResults(){
  return (
    <div>
      Hi JEN!
    </div>
  )
}

export default App;
